	pageSwiper: function(){
		var mySwiper = new Swiper('.swiper-container', {
            direction: 'vertical',
            onSlideChangeEnd: function(swiper) {
                //切换结束时，告诉我现在是第几个slide
                if (swiper.activeIndex == 4) {
                    $('.pulldown').addClass('up');
                } else {
                    $('.pulldown').removeClass('up');
                };
            }
        });
	},
